          "title": "De quoi ChatGPT est-il VRAIMENT capable ? | Ft. Science4All",
          "description": "Merci √† L√™ de @Science4Allfrancais pour sa relecture et sa contribution ! Un point sur lequel il me sugg√®re d'insister et pour lequel je n'ai pas eu le temps d'ajouter une note de bas de page : on peut imaginer que les prochaines g√©n√©rations de ChatBot ne chercheront plus seulement √† pr√©dire ce qu'un humain √©crirait, mais de plus en plus √† pr√©dire ce que les correcteurs humains pr√©f√®rent (parmi les trucs qu'il pr√©dit qu'un humain √©crirait). C'est d√©j√† assez nettement le cas avec GPT-3.5 qui est entra√Æn√© √† √©viter certains sujets comme on l'a vu dans la vid√©o.\n\nMerci aussi √† Rapha√´l Milli√®re dont vous pouvez aller lire l'article ici :\nhttps://nautil.us/welcome-to-the-next-level-of-bullshit-237959/\nOn en avait discut√© en visio il y a un moment, et j'ai renonc√© √† inclure des extraits de notre discussion dans la vid√©o car cela aurait beaucoup compliqu√© le montage (et en plus on ne pouvait pas encore parler de ChatGPT vu que ce n'√©tait pas encore sorti), mais en tout cas je le remercie d'avoir pris ce temps !\n\nMerci aussi √† toutes celles et ceux qui m'ont accompagn√© pendant les lives o√π je testais Cedille ou ChatGPT (certains des tests que je fais dans cette vid√©o m'ont √©t√© directement inspir√© par le chat de ces lives).\n\nL'article que je mentionne sur GPT-3 jouant aux √©checs : https://towardsdatascience.com/gpt-3-play-chess-d123a96096a9\n\nDavid de @ScienceEtonnante me fait remarquer que tous les mod√®les de langage n'ont pas √©t√© entra√Æn√©s √† faire seulement de la pr√©diction de prochain mot (ou prochain *token* pour √™tre exact, ce qui est un peu moins qu'un mot) ; par exemple certains comme BERT de Google sont aussi entra√Æn√©s √† compl√©ter des \"textes √† trou\" (des textes dont 15% des tokens sont cach√©s). Ceci dit, les mod√®les GPT sont bien entra√Æn√©s √† la pr√©diction de prochain token.\n\nEnfin, je me fais √† moi-m√™me la remarque suivante : il y aurait sur les mod√®les de langage bien d'autres choses √† dire qui touchent davantage √† la philosophie, typiquement sur les questions √©thiques, ou sur le rapport au langage et √† l'intelligence. Mais le truc c'est que pour ne pas dire n'importe quoi quand on aborde ces sujets, c'est important d√©j√† de bien comprendre de quoi on parle : que sont les mod√®les de langage et de quoi sont-ils vraiment capables ? Donc c'est surtout sur ce point que j'ai voulu insister dans cette vid√©o parce qu'il me semble important de l'√©claircir pour √©viter de tomber dans des fantasmes (typiquement des fantasmes sur la conscience des chatbots). Si √ßa vous int√©resse que j'approfondisse le sujet maintenant que je l'ai d√©broussaill√©, j'y reviendrai peut-√™tre dans une autre vid√©o ! Dites-moi en commentaire si √ßa vous dit !\n\nSommaire\n\n0:00 - Intro - Qu'est-ce que ChatGPT ?\n2:49 - √Ä quoi les mod√®les de langage sont-ils entra√Æn√©s ?\n6:10 - Test : o√π l'on voit que √ßa ne R√âPOND pas, √ßa PR√âDIT\n10:04 - Mais quand on parle de sujets sensibles...\n11:42 - L√™ sur l'\"√©ducation\" des mod√®les de langage \n14:25 - L√™ pr√©sente Tournesol\n16:51 - ChatGPT : transformer un mod√®le de langage en chatbot\n17:33 - Le probl√®me de Blake Lemoine : un chatbot conscient ?\n21:30 - ChatGPT pr√©tend r√©pondre correctement... \n24:07 - Mais ChatGPT n'est pas du tout fiable.\n27:05 - La machine √† bullshit\n30:13 - ChatGPT peut-il surpasser l'intelligence humaine ?\n33:14 - Quand un mod√®le de langage joue aux √©checs...\n36:19 - Outro\n\n\n__________________________________________\n\n\nüìö Mon livre \"Curiosit√©s philosophiques, de Platon √† Russell\" : https://amzn.to/3KYujSo \nüéß La version en livre audio (lu par mes propres soins) est disponible sur Audible. Pour s'abonner, passer par ce lien permet de soutenir la cha√Æne : https://audible.fr/monsieurphi \nüìö M√©thodo de la dissertation et de l'explication de texte pour le bac : https://amzn.to/3c21RjE\n\nLa principale source de financement de la cha√Æne est le financement participatif. Merci pour tous vos dons !\n\nüí∏ UTIP : https://utip.io/mrphi\n\nOu pour me faire un don direct :\nüí∏ PAYPAL : https://www.paypal.com/paypalme/monsieurphi\n\nPour me suivre ailleurs :\nüéôÔ∏è Twitch: https://www.twitch.tv/monsieurphi\nüê§ Twitter : https://twitter.com/monsieurphi\nüí¨ Discord : https://discord.gg/ky8TqcHu6A\nüë¥ Facebook : https://www.facebook.com/graindephilo/\nüò± Tiktok : https://www.tiktok.com/@monsieurphi\nüå∑ Instagram : https://www.instagram.com/monsieur.phi/\nüíª Sur PeerTube aussi : https://indymotion.fr/video-channels/monsieur_phi/videos\nüëï Et pour acheter des petits goodies : https://utip.io/mrphi/shop\n\nSuivez aussi AXIOME, podcast math√©matico-philosophique avec L√™ (Science4All) \nüçª ---- https://www.youtube.com/channel/UCNHFiyWgsnaSOsMtSoV_Q1A ----\n\nüéôÔ∏è Cha√Æne secondaire replay Twitch : https://www.youtube.com/channel/UCYymKHWbYAowpzGbhE1U3tg"
